import { Swiper, SwiperSlide } from "swiper/react";
import "swiper/css/autoplay";
// Import Swiper styles
import "swiper/css";
import "swiper/css/navigation";
import "swiper/css/pagination";
import "swiper/css/scrollbar";
import { Autoplay, Pagination, Navigation } from "swiper";
import Rectangle16 from "../assets/Rectangle-16.png";
import Rectangle17 from "../assets/Rectangle-17.png";
import Rectangle19 from "../assets/Rectangle-19.png";

export default function StoreDetail() {
  return (
    <div className="store_main">
      <div className="store-cont">
        <div className="store-area">
          <span className="text-heading">Duis aute irure dolor in <br/> reprehenderit in voluptate</span>
          <br />
          <span className="text-desc">
          Excepteur sint occaecat cupidatat non proident, sunt in culpa qui <br /> officia deserunt mollit anim id est laborum.

          </span>
        </div>
      </div>
    </div>
  );
}
